    "store": {"changelog.html":{"url":"changelog.html","title":"getting-started - changelog","body":"\n                   \n\nChangelog\nAll notable changes to this project will be documented in this file.\nThe format is based on Keep a Changelog,\nand this project adheres to Semantic Versioning.\n[Unreleased]\n[Released]\n[1.0.0]\nCreated\n\nThis project by jrquick17\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"coverage.html":{"url":"coverage.html","title":"coverage - coverage","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n    Documentation coverage\n\n\n\n    \n\n\n\n    \n        \n            File\n            Type\n            Identifier\n            Statements\n        \n    \n    \n    \n\n\n\n\n\n    new Tablesort(document.getElementById('coverage-table'));\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"dependencies.html":{"url":"dependencies.html","title":"package-dependencies - dependencies","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    \n        Peer dependencies\n    \n    \n    \n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"index.html":{"url":"index.html","title":"getting-started - index","body":"\n                   \n\nng-konami\n\n\n\n\nIndex\n\nAbout\nSetup\nUsage\nDocumentation\nContributing\nIssues\nDeploy\n\nAbout\nA light weight Angular 2+ service for checking internet speed  \n\nTry out the demo to see it in action!\nVisit my website for other cool projects!\n\nSetup\nInstall Node\nnpm install ng-konami --saveImport module\n\nImport NgKonamiModule by adding the following to your parent module (i.e. app.module.ts):\n  import { NgKonamiModule } from 'ng-konami';\n\n  @NgModule({\n    ...\n    imports: [\n      NgKonamiModule,\n      ...\n    ],\n    ...\n  })\n  export class AppModule {}\n\nUsage\nCheck Internet Speed\n\nCheckout the demo and it's code for more examples.\n\nimport {SpeedTestService} from 'ng-konami';\n\n@Injectable()\nexport class TechCheckService {\n  constructor(\n    private speedTestService:SpeedTestService\n  ) {\n    this.speedTestService.getMbps().subscribe(\n      (speed) => {\n        console.log('Your speed is ' + speed);\n      }\n    );\n  }\n}Check Internet Speed w/ Custom Settings\nimport {SpeedTestService} from 'ng-konami';\n\n@Injectable()\nexport class TechCheckService {\n  constructor(\n    private speedTestService:SpeedTestService\n  ) {\n    this.speedTestService.getMbps(\n      {\n        iterations: 10,\n        file: {\n          path: 'my-custom-image.png',\n          size: 2048\n        },\n        retryDelay: 1500,\n      }\n    ).subscribe(\n      (speed) => {\n        console.log('Your speed is ' + speed);\n      }\n    );\n  }\n}Check If Online\nimport {SpeedTestService} from 'ng-konami';\n\n@Injectable()\nexport class TechCheckService {\n  constructor(\n    private speedTestService:SpeedTestService\n  ) {\n    this.speedTestService.isOnline().subscribe(\n      (isOnline) => {\n        if (isOnline === false) {\n          console.log('Network unavailable.');\n        }\n      }\n    );\n  }\n}Documentation\nFunctions\n\ngetBps() - Get the current internet speed in BPS (bytes per second).\ngetKbps() - Get the current internet speed in KBPS (kilobytes per second).\ngetMbps() - Get the current internet speed in MBPS (megabytes per second).\nisOnline() - Check if the network is available.\n\nSettings\n\nfile - see File Settings (below)\niterations - (default: 3) The number of speed readings to take for the average. \nIncrease iterations the more accurate results, decrease iterations for faster results.\nretryDelay - (default: 500) The number of milliseconds to wait before the next iteration after a network error\n\nFile\n\npath - (default: ~5mb image stored on GitHub) The URL where to download an image for determining internet speed\nsize - (default: ~5mb) The size of the image at the path (in bytes)\nshouldBustCache (default: true) Append GET variable to bust browser cache\n\nContributing\nThanks\n\njrquick17\n\nIssues\nIf you find any issues feel free to open a request in the Issues tab. If I have the time I will try to solve any issues but cannot make any guarantees. Feel free to contribute yourself.\nDeploy\nDemo\n\nRun npm install to get packages required for the demo and then run npm run demo to run locally.\n\nGenerate Docs\n\nRun npm run docs:build\n\nUpdate Version\n\nUpdate version package.json files in both the root and dist/ directory following Semantic Versioning (2.0.0).\n\nBuild\n\nRun npm run build from root.\n\nTest\n\nCopy dist/ contents into demo/node_modules/ng-konami/\nRun from root:  cp -fr dist/* demo/node_modules/ng-konami/\n\n\nRun ng serve from demo/\nRun ng build --prod from demo/\n\nNPM Release\n\nRun npm publish from dist/ directory.\n\nUpdate Changelog\n\nAdd updates to CHANGELOG.md in root.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"license.html":{"url":"license.html","title":"getting-started - license","body":"\n                   \n\nMIT License\nCopyright (c) 2020 Jeremy Quick\nPermission is hereby granted, free of charge, to any person obtaining a copy\nof this software and associated documentation files (the \"Software\"), to deal\nin the Software without restriction, including without limitation the rights\nto use, copy, modify, merge, publish, distribute, sublicense, and/or sell\ncopies of the Software, and to permit persons to whom the Software is\nfurnished to do so, subject to the following conditions:\nThe above copyright notice and this permission notice shall be included in all\ncopies or substantial portions of the Software.\nTHE SOFTWARE IS PROVIDED \"AS IS\", WITHOUT WARRANTY OF ANY KIND, EXPRESS OR\nIMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY,\nFITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. IN NO EVENT SHALL THE\nAUTHORS OR COPYRIGHT HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER\nLIABILITY, WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING FROM,\nOUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR OTHER DEALINGS IN THE\nSOFTWARE.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules.html":{"url":"modules.html","title":"modules - modules","body":"\n                   \n\n\n\n\n    Modules\n\n\n    \n    \n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"overview.html":{"url":"overview.html","title":"overview - overview","body":"\n                   \n\n\n\n    Overview\n\n    \n\n    \n    \n\n\n \n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"}}
